INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('0', '2023-11-23', 'Коммунизм пламя постоянный лететь. Дружно что невозможно тысяча советовать умолять устройство военный.
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('1', '2023-08-23', 'Угодный присесть слишком что мучительно аллея тута хлеб. Актриса горький природа мотоцикл демократия спичка теория. Умолять порядок издали снимать уточнить налево ботинок.', '2.4', '3', '18');
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('2', '2022-07-12', 'Изучить о левый пробовать коммунизм. Металл картинка пробовать кидать пересечь. Покидать очутиться выдержать житель заявление крыса.', '5.4', '36', '31');
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('3', '2023-08-23', 'Решение пол собеседник зеленый наступать вздрагивать похороны. Единый тута запеть академик сходить полевой горький.
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('4', '2022-03-16', 'Прощение головка эффект видимо голубчик. Отметить полюбить указанный. Правление поезд строительство дальний.
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('5', '2023-11-01', 'Мучительно торговля научить выгнать отметить проход.
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('6', '2023-09-04', 'Бок следовательно невозможно труп покинуть. Встать миф голубчик запретить эффект виднеться.
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('7', '2022-11-29', 'Палец плясать число деньги опасность тусклый валюта поздравлять. Заложить очко магазин ведь палка.', '9.3', '30', '5');
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('8', '2023-12-20', 'Вытаскивать ход невозможно карандаш разводить выгнать совет солнце. Запустить вскинуть угроза боец научить зима.', '5.3', '42', '3');
INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('9', '2022-09-28', 'Аж носок бегать редактор поговорить. Успокоиться опасность вперед перебивать.
