INSERT INTO "Comment" ("Id", "CreateDate", "Text", "Rating", "ProductId", "UserId") VALUES ('11', '2023-03-21', 'Пространство совет неправда процесс что дошлый заплакать. Дремать ребятишки кольцо возмутиться ныне совещание песня.', '4.3', '40', '12');
